func LoadDefaultAtlasUI() (atlasId string, tileIds []string) {
	const symbol = "!"
	var tex = loadTexture(symbol, ui)
	var id = LoadTextureAtlas(tex, 16, 16, 0)
	var ids = []string{
		"out1-corner1", "out1-edge1", "out2-corner1", "out2-edge1", "out3-corner1", "out3-edge1",
		"out1-corner2", "out1-edge2", "out2-corner2", "out2-edge2", "out3-corner2", "out3-edge2",
		"divider", "divider-end", "bar", "bar-end", "in-corner1", "in-edge1",
		"step", "step-end", "circle1", "circle2", "in-edge2", "bright",
		"handle", "disabled", "", "shade", "in-corner2", "in-edge3",
	}

	for i := range ids {
		if ids[i] != "" {
			ids[i] = symbol + ids[i]
		}
	}
	var tiles = LoadTextureAtlasTiles(id, 0, 0, ids...)
	return id, tiles
}

